import React from 'react'
import TechnologyList from '../../TechnologyList'
import TechnologyCard from './TechnologyCard'


function Technology3() {
  return (
    <div>
        {
            TechnologyList.map((tech) => {
                <TechnologyCard tech={tech}/>
            })
        }
    </div>
  )
}

export default Technology3
